import React from 'react'
import { MDBCol, MDBContainer,MDBCarousel, MDBCarouselInner } from "mdbreact";
 CarouselFooter = (state) => {
    const { itemArray } = state

    return (
   <MDBContainer>
    <MDBCarousel
      activeItem={1}
      length={itemArray.length}
      showControls={true}
      showIndicators={true}
    //   className="z-depth-1"
    >
      <MDBCarouselInner>
        {itemArray}
      </MDBCarouselInner>
    </MDBCarousel>
     </MDBContainer>
    )
}

export default CarouselFooter
